scripts.komputeintegration_hideBehavior_init:
var onScene1Entry = function(){

  // github button
  var githubContainer = ROYGBIV.getContainer("githubContainer");
  var githubText = ROYGBIV.getText("githubText");
  var colorYellow = "#fabd2f";
  var colorWhite = "#ebdbb2";

  ROYGBIV.onContainerMouseOver(githubContainer, function(){
    ROYGBIV.setTextColor(githubText, colorWhite);
  });

  ROYGBIV.onContainerMouseOut(githubContainer, function(){
    ROYGBIV.setTextColor(githubText, colorYellow);
  });

  ROYGBIV.onContainerClick(githubContainer, function(){
    window.location.assign("https://github.com/oguzeroglu/Kompute", "_blank");
  });

  ROYGBIV.setTextColor(githubText, colorYellow);

  // text
  var infoText = ROYGBIV.getText("infoText");
  var texts = ROYGBIV.isMobile()? [
    "touch the surface to move the player",
    "try to catch the bot",
    "bot is programmed to hide from the player",
    "pinch to zoom in/out",
    "move finger to rotate"
  ]:[
    "click on the surface to move the player",
    "try to catch the bot",
    "bot is programmed to hide from the player",
    "w/s to zoom in/out",
    "a/d to rotate",
    "scroll toucpad/drag mouse to rotate"
  ];

  var infoIndex = 0;
  if (!ROYGBIV.isDefined(ROYGBIV.globals.delayedExecutionID)){
    ROYGBIV.globals.delayedExecutionID = ROYGBIV.executeDelayed(function(){
      if (ROYGBIV.getActiveSceneName() != "scene1"){
        return;
      }

      infoIndex ++;

      if (infoIndex == texts.length){
        infoIndex = 0;
      }

      ROYGBIV.setText(infoText, texts[infoIndex]);

      ROYGBIV.startAnimation(infoText, "anim1");
    }, 3000, true);
  }

  ROYGBIV.setText(infoText, texts[0]);
  ROYGBIV.startAnimation(infoText, "anim1");

  // steering behavior names
  var blended1 = "blended1";
  var blended2 = "blended2";
  var pfb1 = "pfb1";
  var botBlended1 = "botBlended1";
  var botRPB1 = "botRPB1";

  // vector pool
  var vectorPool = ROYGBIV.createVectorPool(20);

  // particle systems
  var circle1 = ROYGBIV.getParticleSystem("circle1");
  ROYGBIV.startParticleSystem({
    particleSystem: circle1,
    startPosition: ROYGBIV.vector(100000, 100000, 100000)
  });

  // get objects
  var floor = ROYGBIV.getObject("floor");
  var obs = ROYGBIV.getObject("obs");
  var steerable1 = ROYGBIV.getObject("steerable1");
  var steerable2 = ROYGBIV.getObject("steerable2");
  var player1Text = ROYGBIV.getText("player1Text");
  var player2Text = ROYGBIV.getText("player2Text");
  var phys = ROYGBIV.getObject("phys");

  ROYGBIV.hide(phys);

  var visuals = [];
  ROYGBIV.executeForEachObject(function(obj, objName){
    if (objName.startsWith("visual")){
      visuals.push(obj);
      ROYGBIV.hide(obj);
      ROYGBIV.startAllAnimations(obj);
    }
  });

  // start animations
  ROYGBIV.startAnimation(obs, "anim1");
  ROYGBIV.startAllAnimations(steerable1);
  ROYGBIV.startAllAnimations(player1Text);
  ROYGBIV.startAllAnimations(player2Text);

  // set active control
  ROYGBIV.setActiveControl(ROYGBIV.createOrbitControl({
    maxRadius: 1100,
    minRadius: 100,
    zoomDelta: 5
  }));

  // steering
  var aStar = ROYGBIV.getAStar("ast1");
  var aStar2 = ROYGBIV.getAStar("ast2");

  ROYGBIV.setSteeringBehavior(steerable2, botBlended1);
  ROYGBIV.hideFrom(steerable2, steerable1);

  var arriveTarget = ROYGBIV.vector();

  var steerable1PathFollowing = false;

  var makeArrive = function(steerableObj, arriveTarget, blended2){
    ROYGBIV.setSteerableTargetPosition(steerableObj, arriveTarget);
    ROYGBIV.setSteeringBehavior(steerableObj, blended2);
    steerable1PathFollowing = false;
  };

  ROYGBIV.setObjectClickListener(floor, function(x, y, z){
    var objPosition = ROYGBIV.getFromVectorPool(vectorPool);
    ROYGBIV.setVector(arriveTarget, x, 50, z);

    ROYGBIV.getPosition(steerable1, objPosition);

    ROYGBIV.findShortestPath(aStar, objPosition, arriveTarget);
    ROYGBIV.setSteeringBehavior(steerable1, blended1);

    steerable1PathFollowing = true;

    ROYGBIV.setParticleSystemPosition(circle1, x, 2, z);
  });

  ROYGBIV.setPathFinishListener(steerable1, "pfb1", function(){
    makeArrive(steerable1, arriveTarget, blended2);
  });

  ROYGBIV.setObjectMouseMoveListener(floor, function(x, y, z){
    var targetVec = ROYGBIV.getFromVectorPool(vectorPool);
    ROYGBIV.setVector(targetVec, x, y, z);

    var sourceVec = ROYGBIV.getFromVectorPool(vectorPool);
    ROYGBIV.getPosition(steerable1, sourceVec);

    ROYGBIV.findShortestPath(aStar2, sourceVec, targetVec);

    for (var i = 0; i < visuals.length; i ++){
      ROYGBIV.hide(visuals[i]);
    }

    var index = 0;
    ROYGBIV.executeForEachWaypoint(aStar2, function(x, y, z){
      var obj = visuals[index ++];
      ROYGBIV.show(obj);
      ROYGBIV.setPosition(obj, x, y, z);
    });

    var obj = visuals[index];
    ROYGBIV.show(obj);
    ROYGBIV.setPosition(obj, x, 50, z);

    var lastWPVisual = visuals[0];
    var lastVec = ROYGBIV.getFromVectorPool(vectorPool);
    ROYGBIV.getPosition(lastWPVisual, lastVec);
    var dist1 = ROYGBIV.distance(sourceVec, lastVec);

    var movingVec = ROYGBIV.getFromVectorPool(vectorPool);
    ROYGBIV.setVector(movingVec, x, y, z);
    var dist2 = ROYGBIV.distance(sourceVec, movingVec);

    if (dist2 < dist1){
      ROYGBIV.hide(lastWPVisual);
    }
  });

  ROYGBIV.setObjectMouseOverListener(floor, function(x, y, z){
    ROYGBIV.startAnimation(obs, "anim2");
    ROYGBIV.freezeAnimationOnFinish(obs, "anim2");
  });

  ROYGBIV.setObjectMouseOutListener(floor, function(){
    for (var i = 0; i < visuals.length; i ++){
      ROYGBIV.hide(visuals[i]);
    }
    ROYGBIV.stopAnimation(obs, "anim2");
    ROYGBIV.unfreezeAnimation(obs, "anim2");
  });

  // object tracking
  ROYGBIV.setPositionChangeListener(steerable1, function(x, y, z){
    ROYGBIV.setTextPosition(player1Text, x, 170, z);

    var v1 = ROYGBIV.getFromVectorPool(vectorPool);
    ROYGBIV.setVector(v1, x, y, z);

    var dist = ROYGBIV.distance(v1, arriveTarget)

    if (steerable1PathFollowing){
      if (dist <= 100){
        makeArrive(steerable1, arriveTarget, blended2);
      }
    }

    if (dist <= 5){
      ROYGBIV.stopSteerable(steerable1);
    }
  });

  ROYGBIV.setPositionChangeListener(steerable2, function(x, y, z){
    ROYGBIV.setTextPosition(player2Text, x, 170, z);
  });
}

var onSceneRotateScreenEntry = function(){

  ROYGBIV.startAllAnimations(ROYGBIV.getSprite("sprite1"));

  var text = ROYGBIV.getText("rotateScreenText");

  var texts = [
    "rotate device",
    "make sure auto-rotate is enabled"
  ];

  var ctr = 0;

  if (!ROYGBIV.isDefined(ROYGBIV.globals.rotateScreenTimerID)){
    ROYGBIV.globals.rotateScreenTimerID = ROYGBIV.executeDelayed(function(){
      ROYGBIV.setText(text, texts[ctr ++]);
      ROYGBIV.startAnimation(text, "anim1");
      if (ctr == 2){
        ctr = 0;
      }
    }, 3000, true);
  }

  ROYGBIV.setText(text, texts[ctr ++]);
  ROYGBIV.startAnimation(text, "anim1");
}

if (ROYGBIV.isMobile() && !ROYGBIV.isOrientationLandscape()){
  ROYGBIV.changeScene("rotateScreen", onSceneRotateScreenEntry);
}else{
  onScene1Entry();
}

ROYGBIV.setScreenOrientationChangeListener(function(isOrientationLandscape){
  if (isOrientationLandscape){
    ROYGBIV.changeScene("scene1", onScene1Entry);
  }else {
    ROYGBIV.changeScene("rotateScreen", onSceneRotateScreenEntry);
  }
});

ROYGBIV.stopScript("kompute-integration_hideBehavior_init");
